import React from "react";

import * as Styled from "./style";
import Tr from "../Tr";
import Th from "../Th";

const Table = ({ headData, bodyData }) => {
  let renderTableHeadData = () =>
    headData.map((data) => <Th width={data.width}>{data.name}</Th>);

  return (
    <Styled.Table>
      <thead>
        <Tr height="20px">{renderTableHeadData()}</Tr>
      </thead>
      <tbody></tbody>
    </Styled.Table>
  );
};

export default Table;
